('31', 'iPhone Original', '10', '10.000', '0.00', '5000.00', '0', '0', '1', '0', 'iphone1', '0', '0', 'iphone111', '0', 'iPhone primera generación  Desbloqueado Nuevo Original', 'iPhone primera generación  Desbloqueado Nuevo Original iPhone primera generación  Desbloqueado Nuevo Original iPhone primera generación  Desbloqueado Nuevo Original iPhone primera generación  Desbloqueado Nuevo Original iPhone primera generación  Desbloqueado Nuevo Original iPhone primera generación  Desbloqueado Nuevo Original iPhone primera generación  Desbloqueado Nuevo Original iPhone primera generación  Desbloqueado Nuevo Original iPhone primera generación  Desbloqueado Nuevo Original iPhone primera generación  Desbloqueado Nuevo Original.', '0.00'),
