('33', '3', '2', '0.000', '3.00', '3.00', '1', '0', '1', '0', '3', '0', '0', '3', NULL, '3', '<div><br></div><h1><span style=\"font-family: &quot;Helvetica Neue&quot;; color: rgb(255, 0, 0);\">3iPhone XR2</span></h1><div><br></div><ul><li>Pantalla 5.8\", 1125 x 2436 pixels\n</li>\n<li>\nProcesador Apple A11 Bionic\n</li>\n<li>\n3GB RAM\n</li>\n<li>\n64GB/256GB, sin microSD\n</li>\n<li>\nCámara: 12 MP, Dual\n</li>\n<li>\nBatería: 2700 mAh\n</li>\n<li>\nOS: iOS 11\n</li>\n<li>\nPerfil: 7.7 mm\n</li>\n<li>\nPeso: 174 g\n</li>\n</ul>\n<p>\niOS 11 es el sistema operativo del Apple iPhone X	, que en cuanto a dimensiones tiene un perfil de 7.7 mm y un peso de 174 g	. Entre las características del Apple iPhone X se destaca una pantalla de 5.8\" con una resolución de 1125 x 2436 pixels.	\nDentro del iPhone X de Apple encontramos un procesador Apple A11 Bionic, acompañado de 3GB de memoria RAM. Además, cuenta con 64GB/256GB de almacenamiento . La cámara trasera es de resolución 12 MP, Dual con captura de video, y la energía es provista por una batería de 2700 mAh.	\nCompletando las especificaciones técnicas del Apple iPhone X, podemos encontrar parlantes stereo para un sonido superior.\n</p>', '3.00'),
